function VoyPanel() {
  return(
   <div>
      <img className="phone_image" src={"../../static/VoyPhone.png"} alt="Phone with Voy App open"/>
      <div className="content">
        <img className="logo" src={"../../static/VoyLogo.png"} alt="Voy App Logo"/>
        <a><b>Venture-backed</b></a>
        <a>audio tour application</a>
      </div>
      <style jsx>{`
        padding-top: 10vh;
        .phone_image{
          padding-left: 25vw;
          height: 55vh;
        }

        .content{
          display: inline-flex;
          padding-top: 15vh;
          padding-left: 5vw;
        }

        .logo{

        }
        a{
          font-size: 3.5vh;
        }
      `}</style>
    </div>
  )
}
export default VoyPanel
